class Solution {
    public int[] findIntersectionValues(int[] nums1, int[] nums2) {
        int count1 = 0;
        int count2 = 0;

        // Create a set from nums2 for efficient lookups
        Set<Integer> set2 = new HashSet<>();
        for (int num : nums2) {
            set2.add(num);
        }

        // Count indices in nums1 with values in nums2
        for (int num : nums1) {
            if (set2.contains(num)) {
                count1++;
            }
        }

        // Create a set from nums1 for efficient lookups
        Set<Integer> set1 = new HashSet<>();
        for (int num : nums1) {
            set1.add(num);
        }

        // Count indices in nums2 with values in nums1
        for (int num : nums2) {
            if (set1.contains(num)) {
                count2++;
            }
        }

        // Return the result
        return new int[]{count1, count2};
    }
}
